import React, { useState } from 'react';
import './Dashboard.css';

const Dashboard = () => {
  const [activeTab, setActiveTab] = useState('apod');

  const tabs = [
    { id: 'apod', label: 'Picture of the Day', icon: 'üåü' },
    { id: 'mars', label: 'Mars Rovers', icon: 'üöÄ' },
    { id: 'neo', label: 'Near Earth Objects', icon: '‚òÑÔ∏è' }
  ];

  const handleTabChange = (tabId) => {
    setActiveTab(tabId);
  };

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <h1>üåå NASA Data Explorer</h1>
        <p>Explore the cosmos with real NASA data</p>
      </header>

      <nav className="dashboard-nav">
        {tabs.map((tab) => (
          <button
            key={tab.id}
            className={`nav-tab ${activeTab === tab.id ? 'active' : ''}`}
            onClick={() => handleTabChange(tab.id)}
          >
            <span className="tab-icon">{tab.icon}</span>
            <span className="tab-label">{tab.label}</span>
          </button>
        ))}
      </nav>

      <main className="dashboard-content">
        <div className="tab-content">
          {activeTab === 'apod' && (
            <div className="coming-soon">
              <h2>üåü Astronomy Picture of the Day</h2>
              <p>Coming soon! This will show NASA's daily astronomy images.</p>
            </div>
          )}
          {activeTab === 'mars' && (
            <div className="coming-soon">
              <h2>üöÄ Mars Rover Gallery</h2>
              <p>Coming soon! Browse photos from Mars rovers.</p>
            </div>
          )}
          {activeTab === 'neo' && (
            <div className="coming-soon">
              <h2>‚òÑÔ∏è Near Earth Objects</h2>
              <p>Coming soon! Track asteroids and comets.</p>
            </div>
          )}
        </div>
      </main>
    </div>
  );
};

export default Dashboard;
